PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0), "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "action_time" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "auth_user" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "last_name" varchar(150) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "first_name" varchar(150) NOT NULL);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "tours_tourdate" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "date" date NOT NULL);
CREATE TABLE IF NOT EXISTS "tours_tour_additional_options" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "tour_id" bigint NOT NULL REFERENCES "tours_tour" ("id") DEFERRABLE INITIALLY DEFERRED, "additionaloption_id" bigint NOT NULL REFERENCES "tours_additionaloption" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "tours_tour_free_services" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "tour_id" bigint NOT NULL REFERENCES "tours_tour" ("id") DEFERRABLE INITIALLY DEFERRED, "freeofchargeservice_id" bigint NOT NULL REFERENCES "tours_freeofchargeservice" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "tours_tour_tour_photo_gallery" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "tour_id" bigint NOT NULL REFERENCES "tours_tour" ("id") DEFERRABLE INITIALLY DEFERRED, "photo_id" bigint NOT NULL REFERENCES "tours_photo" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "tours_cabintype" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "type" varchar(50) NOT NULL, "description" text NOT NULL, "photo" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "tours_lunch" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(50) NOT NULL, "ingredients" text NOT NULL);
CREATE TABLE IF NOT EXISTS "tours_tour_lunch" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "tour_id" bigint NOT NULL REFERENCES "tours_tour" ("id") DEFERRABLE INITIALLY DEFERRED, "lunch_id" bigint NOT NULL REFERENCES "tours_lunch" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "tours_route" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(50) NOT NULL, "description" text NOT NULL, "duration" bigint NOT NULL);
CREATE TABLE IF NOT EXISTS "tours_route_photo" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "route_id" bigint NOT NULL REFERENCES "tours_route" ("id") DEFERRABLE INITIALLY DEFERRED, "photo_id" bigint NOT NULL REFERENCES "tours_photo" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "tours_tour_route" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "tour_id" bigint NOT NULL REFERENCES "tours_tour" ("id") DEFERRABLE INITIALLY DEFERRED, "route_id" bigint NOT NULL REFERENCES "tours_route" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "tours_ship" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(50) NOT NULL, "type" varchar(50) NOT NULL, "description" text NOT NULL, "photo" varchar(100) NOT NULL, "amount_of_places" integer NOT NULL, "cabin_types_id" bigint NOT NULL REFERENCES "tours_cabintype" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "tours_additionaloption" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "option_name" varchar(50) NOT NULL, "option_description" text NOT NULL);
CREATE TABLE IF NOT EXISTS "tours_freeofchargeservice" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "service_name" varchar(50) NOT NULL, "service_description" text NOT NULL);
CREATE TABLE IF NOT EXISTS "tours_photo" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "image" varchar(100) NOT NULL, "description" text NOT NULL);
CREATE TABLE IF NOT EXISTS "tours_tour" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(50) NOT NULL, "tour_description" text NOT NULL, "duration" bigint NOT NULL, "pick_up_time" time NOT NULL, "cost" decimal NOT NULL, "start_date_id" bigint NULL REFERENCES "tours_tourdate" ("id") DEFERRABLE INITIALLY DEFERRED, "author_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "ship_id" bigint NULL REFERENCES "tours_ship" ("id") DEFERRABLE INITIALLY DEFERRED, "cost_options" text NOT NULL);
CREATE TABLE IF NOT EXISTS "tours_order" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "passengers" text NOT NULL, "date" date NOT NULL, "email_of_initiator" varchar(254) NOT NULL, "phone_number" varchar(50) NOT NULL, "messenger" varchar(50) NOT NULL, "cost_per_person" decimal NOT NULL, "cost_of_tour" decimal NOT NULL, "name_of_tour" text NOT NULL, "duration_of_tour" bigint NOT NULL, "status" bool NOT NULL, "tour_id" bigint NOT NULL REFERENCES "tours_tour" ("id") DEFERRABLE INITIALLY DEFERRED, "author_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "bike_rental_bikebrand" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(255) NOT NULL, "logo" varchar(100) NULL);
CREATE TABLE IF NOT EXISTS "bike_rental_bikemodel" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "model" varchar(255) NOT NULL, "transmission" varchar(255) NOT NULL, "displacement" real NOT NULL, "brand_id" bigint NOT NULL REFERENCES "bike_rental_bikebrand" ("id") DEFERRABLE INITIALLY DEFERRED, "description" text NOT NULL, "clearance" integer NOT NULL, "fuel_system" varchar(255) NOT NULL, "tank" real NOT NULL, "gears" integer NULL, "bike_model_photo" varchar(100) NULL);
CREATE TABLE IF NOT EXISTS "bike_rental_order" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "start_date" date NOT NULL, "duration" integer NOT NULL, "amount_bikes" integer NOT NULL, "total_price" decimal NOT NULL, "created_at" datetime NOT NULL, "bike_id" bigint NOT NULL REFERENCES "bike_rental_bike" ("id") DEFERRABLE INITIALLY DEFERRED, "client_id" bigint NOT NULL REFERENCES "bike_rental_client" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "bike_rental_client" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "contact" varchar(100) NOT NULL, "name" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "bike_rental_bike" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "deposit_amount" integer NOT NULL, "amount" integer NOT NULL, "availability" bool NOT NULL, "description" text NOT NULL, "bike_model_id" bigint NOT NULL REFERENCES "bike_rental_bikemodel" ("id") DEFERRABLE INITIALLY DEFERRED, "price_per_day" decimal NOT NULL, "price_per_month" decimal NOT NULL, "price_per_week" decimal NOT NULL, "photo" varchar(100) NULL);
